var markers = L.markerClusterGroup();

for(var i = 0; i < butchers.length; i++) {
    var b = butchers[i];
    try {
        var btitle = b["tags"]["name"];
        var marker = L.marker(new L.LatLng(b["lat"], b["lon"]), {title: btitle});}
    catch(error) {} 
    marker.bindPopup(btitle)
    markers.addLayer(marker);
}


